const initialState = {
    error: null,
    loading: false,
}

export default (state = initialState, action) => {
    switch (action.type) {
        case 'AUTH_START':
            return { ...state, loading: true }
            case 'AUTH_START':
                    return { ...state, loading: true }
        default:
            return state
    }
}
